pub enum LoxError {
    Error {
            line: usize,
            message: String,
        },
    ParseError {
            token: Token,
            message: String,
        },
    Null,
}

pub enum Expr {
    Binary(Rc<BinaryExpr>),
    Grouping(Rc<GroupingExpr>),
    Literal(Rc<LiteralExpr>),
    Unary(Rc<UnaryExpr>),
}
